import React,{Component} from 'react';
import Sidebar from './Sidebar';

class Dashboard extends Component{
    render (){
        return(
            <div>
                <Sidebar />
                <input name="name" placeholder="name"  /><br/><br/>
            </div>
            
            
        )
    }
}

export default Dashboard;
